-- ----------------------------
-- Table structure for t_platform_ipcamera
-- ----------------------------
DROP TABLE IF EXISTS `t_platform_ipcamera`;
CREATE TABLE `t_platform_ipcamera`  (
  `camera_id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '摄像头编号',
  `qid` char(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `camera_nickname` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '摄像头的昵称',
  `camera_status` tinyint(1) UNSIGNED NULL DEFAULT 0 COMMENT '摄像头状态 0 - 未激活 1 - 已激活',
  `camera_isonline` tinyint(1) NULL DEFAULT 0 COMMENT '摄像头是否在线',
  `camera_offline_time` datetime(0) NULL DEFAULT NULL COMMENT '摄像头最后离线时间',
  `camera_time_zone` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '时区，格式为： +08:00',
  `city` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '设备所在城市名称',
  `camera_activate_time` datetime(0) NULL DEFAULT NULL COMMENT '摄像头激活时间',
  `fw_version` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '摄像头当前软件版本号',
  `fw_upgrade_status` tinyint(1) NULL DEFAULT NULL COMMENT 'ipc升级fw的状态(0为成功、1为失败、2为升级中)',
  `fw_upgrade_err_reason` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'fw升级结果说明',
  `fw_upgrade_date` datetime(0) NULL DEFAULT NULL COMMENT '最近fw升级完成时间',
  `battery_level` tinyint(1) NULL DEFAULT 100 COMMENT '电池电量',
  `switch_status` tinyint(1) NULL DEFAULT 0 COMMENT '开关的状态 （1：true, 0: false)',
  `indicator_enable` tinyint(1) NULL DEFAULT 0 COMMENT '指示灯使能 1: true, 0: false',
  `sensor_enable` tinyint(1) NULL DEFAULT 0 COMMENT 'Light sensor使能 (1:true, 0: false)',
  `wifi_ssid` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '设备当前使用的WIFI 的SSID名',
  `create_date` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `l_upd_date` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`camera_id`) USING BTREE,
  UNIQUE INDEX `qid`(`qid`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 21231 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '摄像头主表' ROW_FORMAT = Compact;

